import { ITeamRosterElement } from "../../Interfaces";
import s from "./style.module.css";

const TeamRosterElement: React.FC = ({
  id,
  number,
  avatarUrl,
  name,
  position,
  height,
  weight,
  birthday,
}: ITeamRosterElement) => {
  return (
    <li className={s.item} key={id}>
      <div className={s.number}>{number}</div>
      <div className={s.player}>
        <div className={s.avatar}>
          <img src={avatarUrl} alt={name} />
        </div>
        <div className={s.information}>
          <div className={s.name}>{name}</div>
          <div className={s.position}>{position}</div>
        </div>
      </div>
      <div className={s.height}>{height}</div>
      <div className={s.weight}>{weight}</div>
      <div className={s.age}>
        {Math.floor((Date.now() - Date.parse(birthday)) / 31536000000)}
      </div>
    </li>
  );
};

export default TeamRosterElement;
